.bd-callout {padding: 1.25rem;margin-top: 1.25rem;
  margin-bottom: 1.25rem;border: 1px solid #eee;
  border-left-width: .25rem;border-radius: .25rem}
.bd-callout h4 {margin-top: 0;margin-bottom: .25rem}
.bd-callout p:last-child {margin-bottom: 0}
.bd-callout code {border-radius: .25rem}
.bd-callout + .bd-callout {margin-top: -.25rem}
.bd-callout-info {border-left-color: #5bc0de}
.bd-callout-info h4 {color: #5bc0de}
.bd-callout-warning {border-left-color: #f0ad4e}
.bd-callout-warning h4 {color: #f0ad4e}
.bd-callout-danger {border-left-color: #d9534f}
.bd-callout-danger h4 {color: #d9534f}

body {
  margin: 0;
  padding: 2rem;
  background-color: var(--dark);
  color: var(--light);
}

.items {
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(6.67cm, 1fr));
  grid-auto-rows: 2.54cm;
  grid-gap: 1rem;
}

.item {
  display: flex;
  justify-content: center;
  align-items: center;
  text-align: center;
  border-radius: 10px;
  background-color: var(--light);
  color: var(--dark);
}

@page {
  margin: 0cm;
}


@media print {
  body {
    margin: 0;
    padding: 0;
    background-color: none;
  }

  h1, label, input, .bd-callout {
    display: none;
  }

  .items {
    background-color: none;
    grid-template-columns: 6.67cm 6.67cm 6.67cm;
    grid-gap: 0 0.32cm;
    padding: 1.263cm 0.48cm;
  }

  .item {
